CREATE PROCEDURE public.getmoviesbydirector(IN director_name character varying)
    LANGUAGE plpgsql
    AS $$
BEGIN
    SELECT m.title 
    FROM Movies m
    JOIN Movie_Directors md ON m.movie_id = md.movie_id
    JOIN Directors d ON md.director_id = d.director_id
    WHERE d.name = director_name;
END;
$$;


